import { useState } from "react";
// import SignInForm from "./pages/user/SignInForm.js";
import axios from "axios"

const Login = () => {
    const [data, setData] = useState(null);
    const onClick = async () => {
        try {
        const response = await axios.get(
            'http://3.35.213.205/api/ft/login.php',
        );
            setData(response.data);
        } catch (e) {
            console.log(e);
        }
    };
    return (
        <main>
            <section className="py-5 text-center container">
                <div className="row py-lg-5">
                <div className="col-lg-6 col-md-8 mx-auto">
                    <h1 className="fw-light">주문 리스트</h1>
                    <p className="lead text-muted">
                        가락시장 도매 주문 리스트<br/>
                        로그인후 바코드를 찍어주세요!
                    </p>
                    {/* <p>
                        <button className="btn btn-primary my-2 m-1">로그인</button>
                    </p> */}
                </div>
                </div>
                <div>
        <div>
            <button onClick={onClick}>불러오기</button>
        </div>

        {data && (
            <textarea
                rows={7}
                value={JSON.stringify(data, null, 2)}
                readOnly={true}
            />
        )}
        </div>
            </section>
            {/* {
                view.signIn ? (<SignInForm signInData={signInData} onChangeSignInData={onChangeSignInData} />) : (<></>)

            } */}
            {/* <SignInForm /> */}
        </main>
    );

}

export default Login;
